export default () => (
    <div className="page">
        <div className="ImageArea">
            <img src='/images/star.jpeg'/>
            <p>チャットしてく？？</p>
        </div>
        <SignInArea />
        <style jsx>{`
            .page {
                width: 100%;
                height: 100vh;
                max-width: 1280px;
                display: flex;
            }
            .ImageArea {
                width: 860px;
                height: 100%;
                position: rerative;
            }
            img {
                width: 100%;
                height: auto;
                objectfit: cover;
            }
            p {
                position: absolute;
                top: 20%;
                left: 20%;
                color: #fff;
                font-weight: bold;
                font-size: 32px;
            }
        `}</style>
    </div>
)
